import React, { Component } from 'react';
import NavBar from './navbar';
import {apple,
broccoli, cabbage, carrots, cucumber, eggplant, 
papper, lettuce, okra, peas, tomato, 
onion} from './img';

class App extends Component {
    state = { 
        products:[
            {id:1,name:apple,price:10,img:{apple}},
            {id:2,name:apple,price:10,img:{broccoli}},
            {id:3,name:apple,price:10,img:{cabbage}},
            {id:4,name:apple,price:10,img:{carrots}},
            {id:5,name:apple,price:10,img:{cucumber}},
            {id:6,name:apple,price:10,img:{eggplant}},
            {id:7,name:apple,price:10,img:{papper}},
            {id:8,name:apple,price:10,img:{lettuce}},
            {id:9,name:apple,price:10,img:{okra}},
            {id:10,name:apple,price:10,img:{peas}},
            {id:11,name:apple,price:10,img:{tomato}},
            {id:12,name:apple,price:10,img:{onion}},
        ]
     }
    render() { 
        return ( 
            <NavBar/>
        );
    }
}
 
export default App;
